import React from "react";
import { Grid } from "@mui/material";
import OpenViduSession from "openvidu-react";
import axios from "axios";

import { useSelector, useDispatch } from "react-redux";
import { selectUser } from "../../redux/slice/UserSlice";

export default function AllCam() {
  const roomNum = 1;
  //axios로 토큰 받아오기
  const userAC = useSelector(selectUser);
  axios({
    url: `/api/room/${roomNum}/video-token`,
    method: "get",
    headers: {
      "Content-Type": "application/json",
      Authorization: `Bearer ${userAC}`,
    },
  })
    .then((res) => {
      console.log(res);
    })
    .catch((err) => {
      console.log(err);
    });

  return (
    <Grid container spacing={2}>
      <Grid item xs={4}>
        <Grid>
          <video autoplay playsinline='true'></video>
        </Grid>
        <Grid>cam4</Grid>
        <Grid>cam6</Grid>
      </Grid>
      <Grid item xs={4}>
        <Grid>cam2</Grid>
        <Grid>empty</Grid>
        <Grid>cam7</Grid>
      </Grid>
      <Grid item xs={4}>
        <Grid>cam3</Grid>
        <Grid>cam5</Grid>
        <Grid>cam8</Grid>
      </Grid>
    </Grid>
  );
}
